import React, { Component } from 'react';
import MainTitle from '../components/pageTitle';
import Text from '../components/mainText';
import Coin from '../components/coin';

import '../App.css';

const TableHeader = () => {
  return (
    <thead>
      <tr>
        <th>
          <Text classprop="bold-text" label="Player" />
        </th>
        <th>
          <Coin classprop="stats-coin" />
        </th>
        <th>
          <Text classprop="bold-text" label="Time" />
        </th>
        <th>
          <Text classprop="bold-text" label="Date" />
        </th>
      </tr>
    </thead>
  );
};

const TableBody = () => {
  return (
    <tbody>
      <tr>
        <td>Charlie</td>
        <td>Janitor</td>
      </tr>
      <tr>
        <td>Mac</td>
        <td>Bouncer</td>
      </tr>
      <tr>
        <td>Dee</td>
        <td>Aspiring actress</td>
      </tr>
      <tr>
        <td>Dennis</td>
        <td>Bartender</td>
      </tr>
    </tbody>
  );
};

class Table extends React.Component {
  render() {
    return (
      <table>
        <TableHeader />
        <TableBody stats={tthis.props.stats} />
      </table>
    );
  }
}
export default Table;
